import React from 'react';

const Search = () => {
    return (
        <div>
            <form>
                <input
                    className="outline-none border-none mr-2"
                    type="search"
                    name="search"
                    placeholder="Search"
                />
            </form>
        </div>
    );
};

export default Search;
